import { GET_ORDER_PENDING, GET_ORDERS, ADD_ORDER } from "../_config/const";
import axios from "axios";


export const addOrder = order => {
  return {
    type: ADD_ORDER,
    payload: axios({
      method: "POST",
      url: "http://localhost:5000/api/v1/order/",
      data: order
    })
  };
};

export const getOrderPending = (id) => {
  return {
    type: GET_ORDER_PENDING,
    payload: axios.get("http://localhost:5000/api/v1/order/" + id)
  };
};
